INSERT INTO `page_content` (`page_content_id`, `description`, `content`, `page`) VALUES
(1, 'Home Page', '																	                                       FIRST TIME BUYERS(FREE SILVER) CALL NOW!GOLD SOLD (AT SPOT) SPECIALS CALL NOW!																	<div class="content">\r\n        <p class="heading">Buy Gold Coins</p>\r\n        <p>\r\n                We have helped thousands of customers with expert consultation from our trained professionals with years of experience in all facets of gold coin collecting and selling and buying numismatic rarities and antiquities.  What you see on our web site represents a small sample of our inventory.\r\nWe have access to <u>tens of millions of dollars of inventory</u> through our ten years of experience. Please call one of our gold coin investment analysts to discuss your needs - no one can match our discounted prices on gold coins.\r\n        </p>\r\n        <p class="heading">Stock Market Volatility</p>\r\n        <p>\r\n                Today''s stock market volatility and uncertainty in our financial systems is motivating consumers to buy gold coins and buy silver. No financial asset has or will ever hold value and offer liquidity like gold coins - smart investors buy gold coins to hedge against currency devaluation and offset economic uncertainty in these chaotic times, with an asset that has historical value.\r\n        </p>\r\n        <p class="heading">Why Buying Gold Coins Make Sense</p>\r\n        <p>\r\n                It makes sense to buy gold coins!  Paper money is now on course to be seriously compromised over the next 12-36 months, as the US government and other major countries start to print money in order to finance bailouts of historic proportions.\r\n\r\n        </p>\r\n        <p>\r\n                If you have a distrust of what is going on with our financial institutions, and you are worried about the asset value of your stock portfolio in today''s bear market and paper money then buy gold coins for safety and peace of mind.\r\n        </p>\r\n        <p class="heading">Gold Coins in Today''s Financial Markets</p>\r\n        <p>\r\n                Today''s financial turmoil means the rare coin market is positioned to replicate the bull market that we saw 20 years ago with rare gold coins. As we are hearing much of the same language from the US Government and financial analysts say "we are in severe global recession and crisis and the current market chaos mirrors much of what occurred in 1987..."\r\n        </p>\r\n        <p>\r\n                The US is not alone in this economic upheaval, global economies are experiencing slowdowns, massive credit meltdowns, insolvencies, layoffs, business and bank failures, abandoned projects, and plunging real estate values.\r\n        </p>\r\n        <p>\r\n                Credit Crunch, crisis, meltdown, or even depression -- there is no argument; we are experiencing the most devastating economic shakeup in the world since the 1930s. <u>Rare coins have a fixed and limited supply - we fervently believe there is no better time to buy gold coins.</u>\r\n        </p>\r\n</div>																																	', 'index');
